svg.script:
var manLeft = document.getElementById("manleft");
var manRight = document.getElementById("manright");
var manLeftPath = document.getElementById("manLeftPath");
var manRightPath = document.getElementById("manRightPath");


var languagesText = document.getElementById("languagesText");
var toolsText = document.getElementById("toolsText");

var htmlsvg = document.getElementById("htmlsvg");
var sqlsvg = document.getElementById("sqlsvg");
var csharpsvg = document.getElementById("csharpsvg");
var angularsvg = document.getElementById("angularsvg");
var jssvg = document.getElementById("jssvg");
var wpfsvg = document.getElementById("wpfsvg");
var racketsvg = document.getElementById("racketsvg");
var n1qlsvg = document.getElementById("n1qlsvg");
var javasvg = document.getElementById("javasvg");

var awssvg = document.getElementById("awssvg");
var gitsvg = document.getElementById("gitsvg");
var inkscapesvg = document.getElementById("inkscapesvg");
var mathematicasvg = document.getElementById("mathematicasvg");
var nodesvg = document.getElementById("nodesvg");
var vssvg = document.getElementById("vssvg");
var couchbasesvg = document.getElementById("couchbasesvg");
var electronsvg = document.getElementById("electronsvg");
var jirasvg = document.getElementById("jirasvg");

var opacityConst = 0.3;
var manOpacityConst = 0.5;
var leftColor = "#DD0000";
var rightColor = "#0000DD";
var primaryBlack = "black";

manLeft.style.opacity = manOpacityConst;
manRight.style.opacity = manOpacityConst;

var iconListLeft = [htmlsvg, sqlsvg, csharpsvg, angularsvg, jssvg, wpfsvg, racketsvg, n1qlsvg, javasvg];
var iconListRight = [awssvg, gitsvg, inkscapesvg, mathematicasvg, nodesvg, vssvg, couchbasesvg, electronsvg, jirasvg];

iconListLeft.forEach(function(icon){
  icon.style.opacity = opacityConst;
});

iconListRight.forEach(function(icon){
  icon.style.opacity = opacityConst;
});


function mouseOverLeft(){
  languagesText.style.visibility = "visible";
  manLeft.style.opacity = 1;
  manRight.style.opacity = 1;
  manLeftPath.style.fill = "url(#linearGradient1517)";
  manRightPath.style.fill = "url(#linearGradient1513)";
  iconListLeft.forEach(function(icon){
    icon.style.opacity = 1;
  });
}

function mouseOverRight(){
  toolsText.style.visibility = "visible";
  manLeft.style.opacity = 1;
  manRight.style.opacity = 1;
  manLeftPath.style.fill = "url(#linearGradient1333)";
  manRightPath.style.fill = "url(#linearGradient1337)";
  iconListRight.forEach(function(icon){
    icon.style.opacity = 1;
  });
}

function mouseOutLeft(){
  languagesText.style.visibility = "hidden";
  manLeft.style.opacity = manOpacityConst;
  manRight.style.opacity = manOpacityConst;
  manLeftPath.style.fill = primaryBlack;
  manRightPath.style.fill = primaryBlack;
  iconListLeft.forEach(function(icon){
    icon.style.opacity = opacityConst;
  });
}

function mouseOutRight(){
  toolsText.style.visibility = "hidden";
  manLeft.style.opacity = manOpacityConst;
  manRight.style.opacity = manOpacityConst;
  manLeftPath.style.fill = primaryBlack;
  manRightPath.style.fill = primaryBlack;
  iconListRight.forEach(function(icon){
    icon.style.opacity = opacityConst;
  });
}

manLeft.addEventListener("mouseover", mouseOverLeft, false);
manRight.addEventListener("mouseover", mouseOverRight, false);
manLeft.addEventListener("mouseout", mouseOutLeft, false);
manRight.addEventListener("mouseout", mouseOutRight, false);

iconListLeft.forEach(function(icon){
  icon.addEventListener("mouseover", function(){icon.style.opacity=1;languagesText.style.visibility = "visible";}, false);
  icon.addEventListener("mouseout", function(){icon.style.opacity=opacityConst;languagesText.style.visibility = "hidden";}, false);
});

iconListRight.forEach(function(icon){
  icon.addEventListener("mouseover", function(){icon.style.opacity=1;toolsText.style.visibility = "visible";}, false);
  icon.addEventListener("mouseout", function(){icon.style.opacity=opacityConst;toolsText.style.visibility = "hidden";}, false);
});
